import React, { Component } from 'react'

export default class favbeach extends Component {

    render() {

        return (
            <div>
            <div style={{backroundImage:`require(url("${this.props.displayBeach.photo_1}"))`}}
                key={this.props.displayBeach.id} 
                alt={"a beautiful beach"}>
                <img key={this.props.displayBeach.id} 
                    src={require(`${this.props.displayBeach.photo_1}`)} 
                    alt="beach" 
                    className="img-responsive" />
               The Beach You Clicked_{this.props.displayBeach.name}
               </div>
            </div>
           )    
    }
}
